import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Component from './Component';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' Component={<Component />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
